function toTool(cid,tid){
	history.replaceState({}, null, './?cid='+cid+'&tid='+tid);
	$("#recommend").modal('hide');
	$_GET['tid']=tid;
	$_GET["cid"]=cid;
	$("#cid").val(cid);
	$("#cid").change();
	$("#goodType").hide('normal');
	$("#goodTypeContent").show('normal');
}
